        <ul className="social">
            <li><a className="css-is-deranged"  href="https://github.com/">GitHub</a></li>
            <li><a className="css-is-deranged"  href="https://twitter.com/Viharp2002">Twitter</a></li>
            <li><a className="css-is-deranged"  href="https://www.linkedin.com/in/vihar-prajapati-a52844226">LinkedIn</a></li>
        </ul>

    </footer>  
    </>
  )
}

export default Footer
